import React from 'react';
import SimpleImageSlider from "react-simple-image-slider";

import Nav from './Nav.js';
const images = [
  { url: "images/i4.jpeg" },
  { url: "images/i2.jpeg" },
  { url: "images/i3.jpeg" },

];

const Ab = () => {
  return (
    <div>
        <Nav/>
      <SimpleImageSlider
        width={896}
        height={504}
        images={images}
      />
    </div>
  );
}


export default Ab;
